--
-- Table structure for table `content_moderation`
--

DROP TABLE IF EXISTS `content_moderation`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `content_moderation` (
  `id` int NOT NULL AUTO_INCREMENT,
  `batch_id` varchar(255) DEFAULT NULL,
  `image_path` varchar(255) NOT NULL,
  `original_path` varchar(500) DEFAULT NULL,
  `blurred_path` varchar(500) DEFAULT NULL,
  `final_location` enum('originals','public','public_blurred','paysite','store','rejected','private') DEFAULT 'originals',
  `model_id` int NOT NULL,
  `context_type` enum('profile_pic','public_gallery','premium_gallery','private_content') NOT NULL,
  `usage_intent` enum('public_site','paysite','store','private') DEFAULT 'public_site',
  `nudity_score` decimal(5,2) DEFAULT '0.00',
  `detected_parts` json DEFAULT NULL,
  `part_locations` json DEFAULT NULL,
  `has_nudity` tinyint(1) DEFAULT '0',
  `face_analysis` json DEFAULT NULL,
  `face_count` int DEFAULT '0',
  `min_detected_age` int DEFAULT NULL,
  `max_detected_age` int DEFAULT NULL,
  `underage_detected` tinyint(1) DEFAULT '0',
  `age_risk_multiplier` decimal(4,2) DEFAULT '1.00',
  `image_description` json DEFAULT NULL,
  `description_text` text,
  `description_tags` json DEFAULT NULL,
  `contains_children` tinyint(1) DEFAULT '0',
  `description_risk` decimal(5,2) DEFAULT '0.00',
  `child_detected` tinyint(1) DEFAULT '0',
  `final_risk_score` decimal(5,2) DEFAULT NULL,
  `risk_level` varchar(20) DEFAULT NULL,
  `risk_reasoning` json DEFAULT NULL,
  `moderation_status` enum('pending','approved','flagged','rejected','error') DEFAULT 'pending',
  `flagged` tinyint(1) DEFAULT '0',
  `human_review_required` tinyint(1) DEFAULT '0',
  `auto_rejected` tinyint(1) DEFAULT '0',
  `rejection_reason` text,
  `blur_settings` json DEFAULT NULL,
  `model_notes` text,
  `admin_notes` text,
  `reviewed_by` int DEFAULT NULL,
  `reviewed_at` timestamp NULL DEFAULT NULL,
  `appeal_requested` tinyint(1) DEFAULT '0',
  `admin_override` tinyint(1) DEFAULT '0',
  `confidence_score` decimal(4,2) DEFAULT '0.00',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `pose_analysis` json DEFAULT NULL COMMENT 'Complete pose analysis data from AI',
  `admin_preview_watermarked` tinyint(1) DEFAULT '0',
  `watermark_generated_at` timestamp NULL DEFAULT NULL,
  `preview_access_count` int DEFAULT '0',
  `nsfw_description` text,
  `nsfw_category` varchar(50) DEFAULT NULL,
  `nsfw_confidence` decimal(10,8) DEFAULT NULL,
  `venice_description` text,
  `venice_brief_description` text,
  `venice_detailed_description` text,
  `venice_children_detected` tinyint(1) DEFAULT '0',
  `venice_children_terms` text,
  `venice_processing_error` text,
  `venice_seo_keywords` json DEFAULT NULL,
  `venice_alt_text` varchar(500) DEFAULT NULL,
  `admin_notification_needed` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `reviewed_by` (`reviewed_by`),
