INSERT INTO `etiquette_items_legacy` VALUES (1,1,'Initial Contact','Please introduce yourself politely and include your desired date, time, and duration when reaching out.',NULL,1,1,'2025-08-08 21:41:02','2025-08-08 21:41:02'),(2,1,'Screening Process','For everyone\'s safety, a brief screening process is required for all new clients. This includes basic verification and references.',NULL,2,1,'2025-08-08 21:43:02','2025-08-08 21:43:02'),(3,1,'Advance Booking','I prefer bookings made at least 24 hours in advance. Same-day appointments may be available with an additional fee.',NULL,3,1,'2025-08-08 21:43:25','2025-08-08 21:43:25'),(4,2,'Mutual Respect','I treat all clients with respect and kindness, and I expect the same in return. Rude or disrespectful behavior will not be tolerated.',NULL,1,1,'2025-08-08 21:44:38','2025-08-08 21:44:38'),(5,2,'Professional Boundaries','Our time together is for companionship and social interaction. Please respect all boundaries and guidelines.',NULL,2,1,'2025-08-08 21:44:52','2025-08-08 21:44:52'),(6,2,'Personal Information','Please do not ask for personal information beyond what is shared publicly. Discretion works both ways.',NULL,3,1,'2025-08-08 21:45:12','2025-08-08 21:45:12'),(7,3,'Personal Hygiene','Please arrive freshly showered and well-groomed. Good personal hygiene is essential for a comfortable experience.',NULL,1,1,'2025-08-08 21:45:59','2025-08-08 21:45:59'),(8,3,'Attire','Dress appropriately for our planned activities. I\'ll always be well-dressed and expect the same consideration.',NULL,2,1,'2025-08-08 21:46:12','2025-08-08 21:46:12'),(9,3,'Substances','Please do not arrive under the influence of alcohol or other substances. Light social drinking during our time is acceptable.',NULL,3,1,'2025-08-08 21:46:23','2025-08-08 21:46:23'),(10,4,'Advance Notice','Please provide at least 2 hours notice for cancellations. Last-minute cancellations may result in a cancellation fee.',NULL,1,1,'2025-08-08 21:47:05','2025-08-08 21:47:05'),(11,4,'No-Shows','No-shows without notice will result in being blacklisted from future bookings.',NULL,2,1,'2025-08-08 21:47:16','2025-08-08 21:47:16'),(12,4,'My Cancellations','In the rare event I need to cancel, I\'ll provide as much notice as possible and offer to reschedule.',NULL,3,1,'2025-08-08 21:47:29','2025-08-08 21:47:29'),(13,5,'Confidentiality','Your privacy is paramount. All interactions remain strictly confidential.',NULL,1,1,'2025-08-08 21:49:05','2025-08-08 21:49:05'),(14,5,'Safe Environment','I maintain a safe, clean, and welcoming environment for all meetings.',NULL,2,1,'2025-08-08 21:49:23','2025-08-08 21:49:23'),(15,5,'Professional Communication','All communications are handled professionally and discreetly.',NULL,3,1,'2025-08-08 21:49:33','2025-08-08 21:49:33');
