INSERT INTO `gallery_layout_types` VALUES (1,'masonry','Masonry Grid','Pinterest-style masonry layout with varying heights','{\"gap\": \"1.5rem\", \"columns\": 3, \"item_spacing\": \"1rem\", \"min_item_width\": \"250px\"}','[\"lightbox\", \"lazy_loading\", \"infinite_scroll\", \"filtering\", \"search\"]','{\"item\": \"masonry-item\", \"image\": \"masonry-image\", \"container\": \"masonry-grid\"}','{\"library\": \"masonry\", \"animation\": true, \"auto_resize\": true}','{\"large\": 4, \"mobile\": 1, \"tablet\": 2, \"desktop\": 3}','{\"lazy_load\": true, \"image_optimization\": true, \"progressive_enhancement\": true}',1,'2025-08-15 21:17:43','2025-08-15 21:17:43'),(2,'grid','Responsive Grid','Equal-height grid layout with consistent spacing','{\"gap\": \"1.5rem\", \"columns\": 4, \"aspect_ratio\": \"4/3\", \"item_min_width\": \"200px\"}','[\"lightbox\", \"lazy_loading\", \"hover_effects\", \"filtering\", \"search\", \"sorting\"]','{\"item\": \"grid-item\", \"image\": \"grid-image\", \"container\": \"grid-container\"}','{\"css_grid\": true, \"flex_fallback\": true, \"animation_duration\": \"0.3s\"}','{\"large\": 4, \"mobile\": 1, \"tablet\": 2, \"desktop\": 3}','{\"will_change\": true, \"css_transforms\": true, \"gpu_acceleration\": true}',1,'2025-08-15 21:17:43','2025-08-15 21:17:43'),(3,'carousel','Image Carousel','Horizontal scrolling carousel with navigation controls','{\"gap\": \"1rem\", \"auto_play\": false, \"visible_items\": 1, \"auto_play_speed\": 3000, \"infinite_scroll\": true}','[\"navigation_arrows\", \"dots_indicator\", \"touch_swipe\", \"keyboard_nav\", \"auto_play\"]','{\"nav\": \"carousel-nav\", \"item\": \"carousel-item\", \"track\": \"carousel-track\", \"container\": \"carousel-container\"}','{\"momentum\": true, \"swiper_js\": true, \"snap_points\": true, \"touch_enabled\": true}','{\"mobile\": {\"visible\": 1}, \"tablet\": {\"visible\": 1.5}, \"desktop\": {\"visible\": 2}}','{\"debounced_resize\": true, \"efficient_updates\": true, \"hardware_acceleration\": true}',1,'2025-08-15 21:17:43','2025-08-15 21:17:43'),(4,'lightbox_grid','Lightbox Grid','Thumbnail grid optimized for lightbox viewing','{\"gap\": \"0.5rem\", \"columns\": 6, \"hover_preview\": true, \"thumbnail_size\": \"150px\"}','[\"lightbox\", \"thumbnail_preview\", \"keyboard_nav\", \"fullscreen\", \"zoom\"]','{\"item\": \"lightbox-thumbnail\", \"overlay\": \"lightbox-overlay\", \"container\": \"lightbox-grid-container\"}','{\"zoom_levels\": [1, 2, 4], \"lightbox_library\": \"custom\", \"preload_strategy\": \"adjacent\"}','{\"large\": 8, \"mobile\": 3, \"tablet\": 4, \"desktop\": 6}','{\"image_preloading\": true, \"memory_management\": true, \"smooth_animations\": true}',1,'2025-08-15 21:17:43','2025-08-15 21:17:43');
